      <View style={styles.mainContainer}>
        {/* <Button label={'ENTRAR'}> </Button> */}
        <LoginScreen/>
        <LogoViewer logosourceview={ImportLogo}/>
      </View>

      <StatusBar style='auto'/>
    </View>

  );
}

